const Login = () => {
    
    return (
        <>
    <h3>Login </h3>
    <form>
    <div className="form-group">
          <label htmlFor="emailInput" className="form-label mt-4">
            Email address
          </label>
          <input
            type="email"
            className="form-control"
            id="emailInput"
            aria-describedby="emailHelp"
            placeholder="Enter email"
          />
        </div>
    </form>
    </>
    );
  };
  
  export default Login;
